import React from 'react';
import useStore from '../store/main'
import {Link} from 'react-router-dom';
import './Nav.css';

const MainNav = () => {

    const {changeLogPage} = useStore(state => state)

    return (
        <div className='nav_con'>
            <ul>
                <Link to={"/"}>
                    <li onClick={() => changeLogPage(false)}>Registration</li>
                </Link>
                <Link to={"/logIn"}>
                    <li onClick={() => changeLogPage(true)}>LogIn</li>
                </Link>
                <Link to={"/cards"}>
                    <li>Color Cards</li>
                </Link>
                <Link to={"/users"}>
                    <li >Users</li>
                </Link>
                <Link to={"/icons"}>
                    <li >Icons</li>
                </Link>
            </ul>
        </div>
    );
};

export default MainNav;
